// requires jquery
// requires datatable.js
// require selected, unselected classes and more css

(function ($) {
    var settings;
    var table;
    $.fn.reportGenerator = function (options) {
        // Initiate default settings and override with provided options
        settings = $.extend({
            reportName: "Report",
            fullReport: true,
            onRowSelection: function () { },
            onRowUnSelection: function () { },
            selector: this.selector,
            columnFilter: true,
            rowFilter: true,
            pdfReport: true,
            reportButtonName : "Get Report",
            dynamicLength : true,
            resetButton: true,
            dataFrom: null,
            reportTitle: null,
            recordSelectedClass: "selected",
            dynamicLengthChangerClass: "col-md-3",
            columnFilterClass: "container",
            rowFilterClass : "",
            multiselectBoxClass: "multiselect btn col-md-4",
            multiselectExpandIcon: '<span class="expand-icon material-icons">add_circle</span>',
            multiselectCollapseIcon : '<span class="close-icon material-icons">remove_circle</span>',
            columnSelectorText : "Choose fields",
            columnSelectorClass: "btn-column-filter noselect",
            headingClass: "report-heading",
            reportHeader: 'data:image/png;base64,',
            headers: null,
            data: null,
            reportTheme: 'striped'

        }, options);

        var that = this;

        // Initiate the Data Table, table is a DT object

        table = this.DataTable(settings);
        if (!this.hasClass("report-table")) {
            this.addClass("report-table");
        }

        // bind click events onSelection and UnSelection
        this.on('click', 'td', function () {
            // unselect all the siblings
            $(this).parent().siblings().each(
                function () {
                    $(this).removeClass(settings.recordSelectedClass)
                }
                );
            $(this).parent().toggleClass(settings.recordSelectedClass);
            if ($(this).parent().hasClass(settings.recordSelectedClass)) {
                settings.onRowSelection();
            } else {
                settings.onRowUnSelection();
            }
            return false;
        });

        if (settings.reportTitle != null) {
            this.parent().prepend('<div class="'+settings.headingClass+'">'+settings.reportTitle+"</div>");
        }

        // following segments are optional. But will run by default
        // if dynamic length is chosen
        if (settings.dynamicLength) {
            var lengthChange = '<input class ="'+settings.dynamicLengthChangerClass+'" type="number"  min="1" id="table-length"/>';
            this.parent().parent().append(lengthChange);
            $('#table-length').on('keyup change', function () {
                that.changeLength($(this).val());
            });
        }

        // if columnFilter is required
        if (settings.columnFilter) {
            // multiselect box
            var multiselectId = "multiselect-box";

            // get all the headers and populate the select box       
            var headers = that.getHeaders();

            // go through every column and add a <option tag for the select box>
            var options = '<div class="'+settings.columnFilterClass+'">'
            for (var i = 0; i < headers.length  ; i++) {
                options = options + '<option value="' + i + '">' + headers[i] + '</option>';

            }
            options = options + '</div>';

            var multiselectbox = '<div class="'+settings.multiselectBoxClass+'" id="' + multiselectId + '" multiple="multiple" data-target="multi-0"><div class="'+settings.columnSelectorClass+'"><span class="text">'+settings.columnSelectorText+'</span>'+settings.multiselectCollapseIcon+settings.multiselectExpandIcon+'</div></div>';

            this.parent().parent().append(multiselectbox);
            $('#' + multiselectId).append(options);

            // attach onclick table manipulator event
            $('#' + multiselectId + " .container").children().each(function (element) {
                $(this).on("click", function () {
                    var columnIndex = $(this).val();
                    var column = table.column(columnIndex);
                    $(this).toggleClass("selected");
                    table.column($(this).val()).visible($(this).hasClass("selected"))
                    // get all the selected column index list

                    $(this).siblings().each(function () {
                        table.column($(this).val()).visible($(this).hasClass("selected"))
                    });
                });

            });

            // attach close icon event
            $(".close-icon").on('click', function () {
                for (var i = 0; i < headers.length  ; i++) {
                    var column = table.column(i);
                    // Toggle the visibility
                    column.visible(true);
                }
            })

            $("span.text").on('click', function () {
                $(this).parent().parent().toggleClass("active");
                if ($(this).parent().parent().hasClass("active")) {
                    $(this).siblings(".expand-icon").html("remove_circle");

                } else {
                    $(this).siblings(".expand-icon").html("add_circle");

                }
                multi.open();
            });

            //initiate multiselect
            var multi = new Multiselect('#' + multiselectId);

            $(".expand-icon").on('click', function () {
                $(this).parent().parent().toggleClass("active");
                if ($(this).parent().parent().hasClass("active")) {
                    $(this).html("remove_circle");

                } else {
                    $(this).html("add_circle");

                }
                multi.open();
            });

        }

        //if report pdf report is required
        if (settings.pdfReport) {
            var that = this;
            var getReport = '<a href="#" id="generate-report-button" data-table="' + settings.selector + '" report-name="' + settings.reportName + '" class="btn-report col-md-3">' + settings.reportButtonName + '</a>';
            this.parent().parent().append(getReport);
            this.parent().siblings('.btn-report').on('click', function () {
            that.generateReport();
            });    
        }

        if (settings.resetButton) {
            var resetButton = '<div class="btn-reset" id="table-reset"><i class="material-icons">cached</i></div>';
            this.parent().parent().append(resetButton);

            $("#table-reset").on('click', function () {
                for (var i = 0; i < headers.length ; i++) {
                    table.column(i).visible(true);
                }

                $(".multiselect .container > option").each(function () {
                    $(this).removeClass("selected");
                });

                table.search('').columns().search('').draw();

                $(settings.selector + ' tfoot th input').each(function () {
                    $(this).val('');
                });

                that.changeLength(20);
                $("#table-length").val('');
            });

        }

        if (settings.rowFilter) {
            var columnIndex = 0;
            $( settings.selector + ' tfoot th').each(function () {
                var title = $(this).text();
                $(this).html('<input column-index="' + columnIndex + '" type="text" class="row-filter"/>');
                columnIndex++;
            });

            // attaching the search event listener
            $(settings.selector + ' tfoot th input').on('keyup change', function () {
                table.column($(this).attr("column-index")).search($(this).val()).draw(false);
            });

        }


        if (settings.dataFrom!=null) { 
            that.loadFromApi();
        }

        return this;
    };

    // generate the report based on how the table looks right now
    $.fn.generateReport = function () {
            // this is a table, that is this
            var that = this;
            var headers = that.getHeaders()

            var data = that.tableToJson(that.get(0), headers);

            var doc = new jsPDF('p', 'pt');
            var imgData = settings.reportHeader;
            doc.addImage(imgData, 'JPEG', 0, 0);

            doc.text(450, 40, settings.reportName);
            doc.autoTable(headers, data, {
                startY: 160,
                theme: settings.reportTheme
            });

            doc.save(settings.reportName + ".pdf");

            return doc;
    };

    // converting table data to json and returning it
    $.fn.tableToJson = function tableToJson(table) {
        var data = [];
        // go through cells
        for (var i = 1; i < table.rows.length; i++) {
            var tableRow = table.rows[i];
            // create an array rather than an object
            var rowData = [];
            for (var j = 0; j < tableRow.cells.length; j++) {
                if (tableRow.cells[j].nodeName != 'TH') {
                    rowData.push(tableRow.cells[j].innerHTML)
                }
            }
            data.push(rowData);
        }
        return data;
    };

    // gets headers of the report table - all visible columns
    $.fn.getHeaders = function (){
        var hTable = this.get(0);
        var headers = [];
        for (var i = 0; i < hTable.rows[0].cells.length; i++) {
            headers[i] = hTable.rows[0].cells[i].innerHTML;
        }
        return headers;
    };

    // Loads data to the table via ajax
    $.fn.loadFromApi = function () {
        
        $.ajax({
            url: settings.dataFrom,
            type: "GET",
            dataType: "json"
        }
            ).done(function (dataSet) {
                // clear and add data to table
                table.clear();
                table.rows.add(dataSet).draw();
                return true;
            });
        return false;
    };

    // Changes the length of the Data Table
    $.fn.changeLength = function (length) {
        table.page.len(length).draw();
    };
}(jQuery));